import React , {useState} from 'react';
import Header from './pages/Logon';


function App() {

  const [counter , setCounter] = useState(0);

  function incremets() {
    setCounter(counter +1 );
  }

  return (
    <div>
      <Header>
        counter:{counter}
      </Header>
      <button onClick={incremets}>Add</button>
    </div>

  );
}

export default App;
